import React from 'react';

import SiteNavbar from './SiteNavbar';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import TeamPhotoSmall from '../img/teamPhotoSmall.png';

const About = () => {
	return (
		<div>
			<SiteNavbar />
			<Container fluid style={style.Header}>
				<Row
					className="justify-content-center align-items-center"
					noGutters="true"
				>
					<h1 style={style.Header1}>About Us</h1>
				</Row>
			</Container>
			<Container fluid>
				<Row className="justify-content-center">Founded in january 2020</Row>
			</Container>
			<h1>About</h1>
		</div>
	);
};

const style = {
	Header: {
		backgroundImage: `url(${TeamPhotoSmall})`,
		backgroundRepeat: 'no-repeat',
		backgroundSize: '100%',
		padding: '0',
	},
	Header1: {
		fontSize: '72px',
		fontFamily: 'Titillium Web',
		padding: '6% 0',
	},
};

export default About;
